function addNewData(userArray) {
  const newArray = userArray.map((user) => {
    const newUser = { ...user };

    const orgUnitPath = newUser["Org Unit Path [Required]"].split("/");
    newUser["Org Unit ID"] = orgUnitPath[orgUnitPath.length - 1];
    newUser["Org Unit Name"] = orgUnitPath.pop();

    newUser["Org Unit Name"] = newUser["Org Unit Name"].replace(/_/g, " ");

    newUser["Org Unit Name"] = newUser["Org Unit Name"]
      .replace(/\d+/g, "")
      .trim();
    delete newUser["Org Unit Path [Required]"];

    delete newUser["2sv Enrolled [READ ONLY]"];
    delete newUser["2sv Enforced [READ ONLY]"];
    delete newUser["Building ID"];
    delete newUser["Floor Name"];
    delete newUser["Floor Section"];
    delete newUser["Email Usage [READ ONLY]"];
    delete newUser["Drive Usage [READ ONLY]"];
    delete newUser["Photos Usage [READ ONLY]"];
    delete newUser["Storage limit [READ ONLY]"];
    delete newUser["Storage Used [READ ONLY]"];
    delete newUser["Change Password at Next Sign-In"];
    delete newUser["New Status [UPLOAD ONLY]"];
    delete newUser["Manager Email"];
    delete newUser["Work Phone"];
    delete newUser["Home Phone"];
    delete newUser["Mobile Phone"];
    delete newUser["Work Address"];
    delete newUser["Home Address"];
    delete newUser["New Primary Email [UPLOAD ONLY]"];
    delete newUser["Recovery Email"];
    delete newUser["Home Secondary Email"];
    delete newUser["Work Secondary Email"];
    delete newUser["Recovery Phone [MUST BE IN THE E.164 FORMAT]"];
    delete newUser["Password Hash Function [UPLOAD ONLY]"];
    delete newUser["Password [Required]"];

    return newUser;
  });

  return newArray;
}

export const newArray = addNewData(usersSMK);

const uniqueData = newArray.filter(
  (item, index, self) =>
    index ===
    self.findIndex((t) => t["Org Unit Name"] === item["Org Unit Name"])
);

export const orgUnitNamesArray = uniqueData.map((dataObject) => ({
  "Org Unit Name": dataObject["Org Unit Name"],
}));

const result = [];

// Loop through the first data
for (const item1 of orgUnitNamesArray) {
  const orgUnitName = item1["Org Unit Name"];
  let activated = 0;
  let notActivated = 0;

  for (const item2 of newArray) {
    if (item2["Org Unit Name"] === orgUnitName) {
      // If a match is found, add to activated or notActivated
      if (item2["Last Sign In [READ ONLY]"] !== "Never logged in") {
        activated++;
      } else {
        notActivated++;
      }
    }
  }

  result.push({
    "Org Unit Name": orgUnitName,
    activated,
    notActivated,
  });
}

result.sort((a, b) => b.activated - a.activated);

export const dataSMK = result;
